INSERT INTO `v1_7f57c08e34068bb600b4846da57427fd1d5137ca06b593317c642e4115f78e27` VALUES ("部員3", 16000, 1, 3, 3, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "ホームランを連発すると、連発数に応じてパワーアップする", 3, 0, "アドレナリン");
INSERT INTO `v1_7f57c08e34068bb600b4846da57427fd1d5137ca06b593317c642e4115f78e27` VALUES ("{0}", 30000, 1, 2, 2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "幸運のハプニングを呼び込む", 4, 2, "ラッキー");
